import * as React from "react";
import data from "../mock-data.json";

export const Table = () => {
  const [workouts, setWorkout] = React.useState(data);

  const renderTableData = () => {
    return workouts.forEach({ exerciseId, exerciseName, rep, sets });
  };
  // const renderTableData = () => {
  //   workouts.forEach((exercise) => {
