  //         <td>{rep}</td>
  //         <td>{sets}</td>
  //       </tr>
  //     );
  //   });
  // };

  return (
    <div className="table-container">
      <table className="center">
        <thead>
          <tr>
            <th>Exercise</th>
            <th>Sets</th>
            <th>Reps</th>
          </tr>
        </thead>
        <tbody>{renderTableData()}</tbody>
      </table>
    </div>
  );
};

